import React from "react";

import styles from "./About.module.css";

const About = () => (
  <div className={styles["about"]}>
    <h2>Hola, Soy Angelito</h2>
    <p>Soy un ñoño, me gusta gusta el sushi y los perritos esponjosos</p>

    <p>
      Trabajo con React y mucho de su ecosistema (redux, redux-saga, react
      native, redux-form, etc.)
    </p>

    <p>
      Proximamente actualizaré este sitio ya que es muy viejo y hoy (5/jul/2020)
      sólo lo pase de Nuxt.js (Vue) a Next.js (React).
    </p>
  </div>
);

export default About;
